INSERT INTO public.product (product_id, description, name, value, owner_id) VALUES ('4f9ac3f5-c1b2-4199-96b2-f40d0ffd9eaa', 'zytaj swoje ulubione tytuły gdziekolwiek się udasz, bo Kindle 10 czarny pozwoli Ci zabrać ze sobą całą bibliotekę. Ekran 6 zamknięty w obudowę o kompaktowych rozmiarach i wytrzymała bateria sprawiają, że jest idealnym partnerem podróży. Z łatwością zmieścisz go w podręcznym bagażu, a do tego łatwo obsługiwać go jedną ręką.', 'Amazon Kindle 10 2019 4GB', 399, '02346256-44b2-4811-917a-6ad03c56036e');
INSERT INTO public.product (product_id, description, name, value, owner_id) VALUES ('1896bffa-a284-446b-93a8-b6e0316fd546', 'Dron DJI Mavic Air 2 oferuje mnóstwo nowych możliwości, dużą moc i niespotykaną dotąd swobodę użytkowania, wznosząc się w ten sposób na nowy, wyższy poziom. To wszystko zamknięto w przemyślanej, kompaktowej konstrukcji, którą dzięki swoim niewielkim rozmiarom, możesz zabrać ze sobą niemal wszędzie. Inteligentne opcje nagrywania filmów połączone ze świetną jakością rejestrowania obrazu i zasięgiem lotu do 6000 metrów* sprawią, że tworzenie prawdziwych dzieł filmowych będzie na wyciągnięcie ręki. Dron Mavic Air 2 został wyposażony w bardziej bezpieczne i inteligentne funkcje lotu. Dzięki temu, Ty możesz skupić się na tworzeniu i cieszyć się każdą chwilą.', 'DJI Mavic Air 2 Combo', 4999, '02346256-44b2-4811-917a-6ad03c56036e');
INSERT INTO public.product (product_id, description, name, value, owner_id) VALUES ('2db2f06e-8776-4a78-962d-346e1bcf1927', 'Poczuj różnicę z klawiaturą mechaniczną SteelSeries Apex 7, wyposażoną w autorskie przełączniki SteelSeries QX2 Red. Dołącz do gry i zmień poziom rozgrywki. SteelSeries Apex 7 to klawiatura, która jest gotowa na ekstremalne wyzwania. Wyposażona w inteligentny wyświetlacz OLED dostarcza informacje bezpośrednio z gier i aplikacji. Rama została wykonana z aluminium serii 5000, a podpórka pod nadgarstki sprawi, że każda zacięta sesja będzie tylko i wyłącznie przyjemnością. Całość uzupełnia pełne blasku, konfigurowalne podświetlenie RGB.', 'SteelSeries Apex 7 Red Switch', 749, '02346256-44b2-4811-917a-6ad03c56036e');
INSERT INTO public.product (product_id, description, name, value, owner_id) VALUES ('073a8f6c-4b2e-4ddc-9feb-2aa9a9faf1a3', 'Fiat F500 F55 to składana, hulajnoga elektryczna w kolorze czerwonym od firmy Fiat, która łączy świetną zabawę z praktycznymi zastosowaniami. Jest odpowiednikiem klasycznej hulajnogi w nowoczesnym wykonaniu. Świetnie nadaje się dla dzieci i młodzieży, a jej maksymalne obciążenie wynosi 70 kg.', 'Fiat F500 5,5', 799, '02346256-44b2-4811-917a-6ad03c56036e');
INSERT INTO public.product (product_id, description, name, value, owner_id) VALUES ('1f119513-37d8-42a1-aa72-7a26184730da', 'Seria VOID to innowacyjne słuchawki dla najbardziej wymagających graczy, którzy zawsze chcą być o krok przed swoimi przeciwnikami.', 'Corsair Gaming VOID PRO', 329, '02346256-44b2-4811-917a-6ad03c56036e');
INSERT INTO public.product (product_id, description, name, value, owner_id) VALUES ('5235507a-74b3-4f8d-b392-ba63cf29961b', 'Konsola Xbox One S i gra Gears 5 tworzą idealny zestaw. Wykorzystaj ogromną moc Xbox One S, do zdobycia przewagi nad przeciwnikami, tocząc pełne emocji boje oraz korzystając z rozrywki w rozdzielczości 4K. Imponująca szczegółowość oraz dynamika obrazu przeniosą Cię w serce zmagań, potęgując efekty wizualne intensywnymi kolorami oraz możliwościami trybu HDR.', 'Microsoft Xbox One S + STAR WARS: Upadły Zakon', 1299, '02346256-44b2-4811-917a-6ad03c56036e');


